import React, { Component } from 'react';
import Cards from './Components/Cards/Cards';
import Charts from './Components/Charts/Charts';
import Selector from './Components/Selector/Selector';



class App extends Component {
  render() { 
    return ( 
      <div>
        <Selector />
        <Cards />
        <Charts />
      </div>
     );
  }
}

export default App;
